import {onepaint,twopaint, threepaint, fourpaint} from './Painting';
import {onesculp,twosculp, threesculp, foursculp} from './Sculpture';

const All = () =>{
    
    return (
        <div>
            <Gallerynav />
            {/*<button type="button" class="btn" onclick = {()=>{}}>⚙</button>*/}
        <div class="grid-container">
        
        
        <div class="grid-item">
        <button type="button" class="btn" onclick = {()=>{}}>⚙</button>
            {onepaint} 
            [모나리자]<br/>
            [2000-00-00]
         </div>
         
        <div class="grid-item">
            {twopaint}
            
        </div>
        <div class="grid-item">{threepaint}
        </div>
        <div class="grid-item">{fourpaint}
        </div>
        <div class="grid-item">{onesculp}
        </div>
        <div class="grid-item">{twosculp}
        </div>
        <div class="grid-item">{threesculp}
        </div>
        <div class="grid-item">{foursculp}
        </div>
        </div>
        </div>

        
        
        
    );
    
}


export default All;
